Закуски корейские острые. 
Закуски из сырых овощей: из моркови, "Морковь-ча", из свеклы, "Свекла-ча", из капусты белокочанной, из редьки, из огурцов, из ростков маша; 
Закуски из сырых овощей, грибов, консервированных овощей, плодов: из опят, из моркови с шампиньонами, овощная с грибами, ассорти "азия", ассорти с грибами, закуска "Ассорти", из кукурузных початков, из золотых нитей, из сушеных древесных белых грибов, из сушеных древесных черных грибов; 
Закуски из вареных, жареных, тушеных овощей: из цветной капусты, из сушеных опят черных, из сушеных белых грибов, из папоротника с грибами, из морской капусты, из баклажанов, из ашлям-фу, аджика по-корейски, закуска Тяй жареный, из спаржи соевой, из фунчезы с морковью; 
Закуски с добавлением мяса, птицы, рыбы, морепродуктов: хе из сердца, хе из рубца, хе из горбуши с морковью, хе из моркови с говядиной, хе из курицы с морковью, из моркови с кальмарами, хе из языка, хе из свиных ушек, хе из креветок, хе из осьминожек, хе из куриных желудочков, хе из мидий, морской коктейль; 
Закуски из маринованных, квашенных, соленых овощей: белокочанная капуста по корейски "Чим Чи", закуска корейская "Ассорти", закуска из папоротника, белокочанная капуста по корейски "Пекинская".

